import React from "react";
import { useNavigate, Link } from "react-router-dom";
import { LayoutDashboard, Users, BarChart2, LogOut } from "lucide-react";

export default function AdminNavbar() {
  const navigate = useNavigate();

  function logout() {
    localStorage.clear();
    navigate("/admin/login");
  }

  return (
    <nav className="bg-gray-900 text-white p-4 flex justify-between items-center">
      <h1 className="text-xl font-semibold">ðŸ’³ Admin Panel</h1>
      <div className="flex gap-6 items-center">
        <Link to="/admin/dashboard" className="flex items-center gap-1 hover:text-blue-400">
          <LayoutDashboard size={18} /> Dashboard
        </Link>
        <Link to="/admin/clients" className="flex items-center gap-1 hover:text-blue-400">
          <Users size={18} /> Clients
        </Link>
        <Link to="/admin/stats" className="flex items-center gap-1 hover:text-blue-400">
          <BarChart2 size={18} /> Stats
        </Link>
        <button onClick={logout} className="flex items-center gap-1 hover:text-red-400">
          <LogOut size={18} /> Logout
        </button>
      </div>
    </nav>
  );
}
